-- ----------------------------
-- Function structure for `get_all_parent_node`
-- ----------------------------
DROP FUNCTION IF EXISTS `get_all_parent_node`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `get_all_parent_node`(`targetId` varchar(100)) RETURNS varchar(1000) CHARSET utf8
BEGIN
    declare resultNode varchar(1000);     --     返回的结果字符串
    declare parentNode varchar(1000);     --     每次查询的父节点
    set resultNode="";
    set parentNode=targetId;
    
    while parentNode is not null do       --     当父节点不为空时执行
        if (parentNode!=targetId)  then
            if(resultNode!="") then                
                set resultNode = concat(resultNode, ",", parentNode);
            else
                set resultNode = concat(parentNode);
            end if;
        end if;
        select group_concat(PARENTID) into parentNode from projectdirectory where find_in_set(DIRECTORYID, parentNode) > 0;        
    end while;
    return resultNode;
END
;;
DELIMITER ;
